import React from 'react';

function Leaderboard({ leaderboardData }) {
  return (
    <div>
      <h2>Top-Voted Stories</h2>
      <table>
        <thead>
          <tr>
            <th>Story</th>
            <th>Upvotes</th>
          </tr>
        </thead>
        <tbody>
          {leaderboardData.map((story, index) => (
            <tr key={index}>
              <td>{story.storyText}</td>
              <td>{story.upvotes}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Leaderboard;
